DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `adp_busqueda_subasta`(
`param_marcaid` int,
`param_modeloid` int,
`param_anio` int,
`param_damageid` int,
`param_stateid` int,
`param_color` varchar(100)
)
BEGIN
DECLARE bMarca varchar(500) Default '';
DECLARE bModelo varchar(500) Default '';
DECLARE bDamage varchar(500) Default '';
DECLARE bState varchar(500) Default '';

SELECT max(descripcion) INTO bMarca from amarca WHERE marcaid = param_marcaid;
SELECT max(descripcion) INTO bModelo from amodelo WHERE marcaid = param_marcaid and modeloid = param_modeloid;
SELECT max(descripcion_us) INTO bDamage from damage WHERE damageid = param_damageid;
SELECT max(descripcion) INTO bState from country_state WHERE stateid = param_stateid;

SELECT * 
FROM adp_subasta a 
WHERE UPPER(a.Marca) = (CASE WHEN param_marcaid > 0 THEN UPPER(bMarca) ELSE UPPER(a.Marca) END)
AND UPPER(a.Modelo) = (CASE WHEN param_modeloid > 0 THEN UPPER(bModelo) ELSE UPPER(a.Modelo) END) 
AND UPPER(a.Danio) = (CASE WHEN param_damageid > 0 THEN UPPER(bDamage) ELSE UPPER(a.Danio) END) 
AND UPPER(a.Anio) = (CASE WHEN param_anio > 0 THEN param_anio ELSE UPPER(a.Anio) END) 
AND UPPER(a.Locacion) = (CASE WHEN param_stateid > 0 THEN UPPER(bState) ELSE UPPER(a.Locacion) END);


END ;;
